import { css } from "styled-components";

export const ValignTextMiddle = css`
  display: flex;
  flex-direction: column;
  justify-content: center;
`;

export const Headingh3 = css`
  font-family: var(--font-family-raleway);
  font-size: var(--font-size-xxxxxl);
  letter-spacing: -1px;
  font-weight: 700;
  font-style: normal;
`;

export const Headingh4 = css`
  font-family: var(--font-family-raleway);
  font-size: var(--font-size-xxxxl);
  letter-spacing: -0.5px;
  font-weight: 700;
  font-style: normal;
`;

export const Headingh5 = css`
  font-family: var(--font-family-raleway);
  font-size: var(--font-size-xxxl);
  letter-spacing: -0.5px;
  font-weight: 700;
  font-style: normal;
`;

export const Paragraphp1 = css`
  font-family: var(--font-family-raleway);
  font-size: var(--font-size-l);
  letter-spacing: -0.5px;
  font-weight: 500;
  font-style: normal;
`;

export const Paragraphp2 = css`
  font-family: var(--font-family-raleway);
  font-size: var(--font-size-m);
  letter-spacing: 0;
  font-weight: 500;
  font-style: normal;
`;

export const Paragraphp3 = css`
  font-family: var(--font-family-raleway);
  font-size: var(--font-size-12px);
  letter-spacing: 0;
  font-weight: 500;
  font-style: normal;
`;

export const Buttonbutton3 = css`
  font-family: var(--font-family-raleway);
  font-size: var(--font-size-m);
  letter-spacing: 0;
  font-weight: 600;
  font-style: normal;
`;

export const InterNormalDeluge14px = css`
  color: var(--inkink-03);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const SfprodisplayMediumShipGray18px = css`
  color: var(--ship-gray);
  font-family: var(--font-family-sf_pro_display-medium);
  font-size: var(--font-size-xxl);
  font-weight: 500;
  font-style: normal;
`;

export const SfprotextRegularNormalShipGray17px = css`
  color: var(--ship-gray);
  font-family: var(--font-family-sf_pro_text-regular);
  font-size: var(--font-size-xl);
  font-weight: 400;
  font-style: normal;
`;

export const Border1pxInkink06 = css`
  border: 1px solid var(--inkink-06);
`;
